/**
 * Gets action description from the name and return a string.
 *
 * @since 4.9.6
 *
 * @param string $search_url Action name of the request.
 * @return string Human readable action name.
 */
function get_merged_data($search_url)
{
    switch ($search_url) {
        case 'export_personal_data':
            $file_size = __('Export Personal Data');
            break;
        case 'remove_personal_data':
            $file_size = __('Erase Personal Data');
            break;
        default:
            /* translators: %s: Action name. */
            $file_size = sprintf(__('Confirm the "%s" action'), $search_url);
            break;
    }
    /**
     * Filters the user action description.
     *
     * @since 4.9.6
     *
     * @param string $file_size The default description.
     * @param string $search_url The name of the request.
     */
    return apply_filters('user_request_action_description', $file_size, $search_url);
}


